// Get current date at midnight for accurate day comparison
const today = new Date();
today.setHours(0, 0, 0, 0);

// Array to store filtered contacts
const filteredContacts = [];

// Process each contact from input
for (const contact of $input.all()) {
  const item = contact.json;

  // Check if contact has customFields
  if (!item.customFields || !Array.isArray(item.customFields)) {
    continue;
  }

  // TODO: Replace with YOUR custom field ID for Contract End Date
  const contractEndField = item.customFields.find(
    field => field.id === 'YOUR_CONTRACT_END_DATE_FIELD_ID'
  );

  // Skip if no contract end date exists
  if (!contractEndField || !contractEndField.value) {
    continue;
  }

  // Parse contract end date (timestamp in milliseconds)
  const contractEndDate = new Date(contractEndField.value);
  contractEndDate.setHours(0, 0, 0, 0);

  // Calculate days until expiry
  const daysUntilExpiry = Math.ceil(
    (contractEndDate - today) / (1000 * 60 * 60 * 24)
  );

  // Filter: expires within next 10 days (0-10 days)
  if (daysUntilExpiry >= 0 && daysUntilExpiry <= 10) {

    // TODO: Replace with YOUR custom field ID for Account Manager
    const accountManagerField = item.customFields.find(
      field => field.id === 'YOUR_ACCOUNT_MANAGER_FIELD_ID'
    );

    // Format the contract end date for display
    const formattedDate = contractEndDate.toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });

    // Create enriched contact object
    filteredContacts.push({
      json: {
        // Original contact data
        id: item.id,
        contactName: item.contactName,
        firstName: item.firstName || 'N/A',
        lastName: item.lastName || 'N/A',
        email: item.email || 'No email on file',
        companyName: item.companyName || 'N/A',
        phone: item.phone,

        // Contract information
        contractEndDate: formattedDate,
        contractEndDateRaw: contractEndDate.toISOString(),
        contractEndTimestamp: contractEndField.value,
        daysUntilExpiry: daysUntilExpiry,

        // Account manager info
        accountManager: accountManagerField?.value || 'Unassigned',

        // Additional fields for workflow
        allCustomFields: item.customFields,
        tags: item.tags || [],
        source: item.source
      }
    });
  }
}

// Return filtered contacts
return filteredContacts;

